import "./App.css";
import { useEffect, useState } from "react";
import { getNewStoryIds, getStoryWithID } from "./APICalls/getApiStories";

const App = () => {
  const [newStories, setnewStories] = useState([]);
  const [story, setStory] = useState([]);

  useEffect(() => {
    getNewStoryIds().then((stories) => {
      setnewStories(stories);
    });
    console.log(newStories);

    getStoryWithID().then((story) => {
      setStory(story);
    });
    console.log(story);
  }, []);

  return (
    <main>
      <div className="news-card">
        <div className="news-card-counter">
          <p>1.</p>
        </div>
        <div className="news-card-body">
          <div className="card-title">
            <span className="title">Closing 45% of the open Emacs bugs</span>{" "}
            <span classNAme="title-url">(ingebrigtsen.no)</span>
          </div>
          <div className="card-stats">
            <span className="stats">
              72 points by clircle 1 hour ago | hide | 23 comments
            </span>
          </div>
        </div>
      </div>
    </main>
  );
};

export default App;

